ads.description:
Sprzedam Toyotę Yaris 1.4 D4D 2003r.

Samochód w pełni sprawny.



Zadzwoń, a wszystko Ci opowiem.

Przebieg 269 tys.km.



Co zrobione:

- Nowy akumulator;

- nowy generator;

- nowa miska olejowa;

- wymienione klocki przód i tył;

- Wymiana łożyska koła tylnego prawego;

- wymieniony czujnik położenia wału korbowego;

- Zaciągnij hamulec ręczny;

- Wymienione stabilizator przód;

- wymienione przewody hamulcowe przód;

- Zamontowano podłokietnik;

- Zainstalowano nowe radio pioneer;

- dwa komplety dywaników w prezencie;

- wypolerowane reflektory;



Samochód jest już na oponach zimowych. Dorzucam w prezencie opony letnie, nowe klocki hamulcowe tył, filtr, drążek stabilizatora, zestaw naprawczy tylnego zacisku oraz inne części zamienne.



Samochód jest w idealnym stanie, wszystko działa, jest klimatyzacja, kierownica wielofunkcyjna, elektryczne lusterka, muzyka, elektryczne szyby, podgrzewane szyby.



Minusem jest rysa na prawym-lewym błotniku, ale tak kupiłem auto i nie ma to żadnego wpływu.
